import React from 'react';

function Form(){
    return(
  <div>
       <form className="Form">
         <input type="text" placeholder="Enter Name"  className="input"/><br />
         <textfield type="text" placeholder="Enter Address" className="input" /><br />
         <input type="number" placeholder="Enter Contact number" className="input"/><br />
         <input type="email" placeholder="Enter Email" className="input"/><br />
         <input type ="number" placeholder="Enter Quntity" className="input"/>
       </form>
     </div> 
    )
}
export default Form;
